import  snow from '../../images/snow.jpg';
const Links= () =>{

    return(

        <>
        <div className="media links-bg rounded-smn">
            <img src={snow} alt = "snow" className="link-icon link-radius"/>
            <div className="media-body p-2"><h5>Bhargava</h5></div>
        </div>
        </>
    );
};

export default Links;
